import React, {useState} from "react";

function Registrarse(){

    const[miRegistro, setRegistro]= useState("false");
    const[usuario, setUsuario]=useState("");
    const[contraseña, setContraseña]=useState("");

    function Confirmar(){
        if(usuario.length === 0||contraseña.length ===0){
            alert("datos Incompletos")
        }
        else{
            setRegistro=true;
        }
    }
    return(<>
    <h2>Registrarse</h2>
    <p><input type="text" placeholder="Usuario" onChange={(e)=>setUsuario(e.target.value)}/></p>
    <p><input type="password" placeholder="Contraseña" onChange={(e)=>setContraseña(e.target.value)}/></p>
    <p><input type="button" className="entrada" value="Confirmar" onClick={Confirmar}/></p>
    </>
    )
}
export default Registrarse;
